import { List, Avatar, Button } from "antd";
import { useDispatch, useSelector } from "react-redux";

const Cart = () => {
  const { cart } = useSelector((state) => state.cart);
  console.log(cart);
  return (
    <>
      <List
        dataSource={cart}
        itemRender={(item) => {
          <List.Item>
            <List.Item.Meta
              title={item.title}
              avatar={<Avatar src={item.Images[0].url} description={item.price} />}
            />
          </List.Item>;
        }}
      ></List>
    </>
  );
};

export default Cart;
